import React, { Component } from 'react'

class Project extends Component {
    render() {
        return(
        <div className="condiv project">
            <h1 className="subtopic">Project</h1>
                <img src="./img/Colmar Academy.png" className="Colmar" to="https://wannee19.github.io/colmar-academy/" />
                <img src="./img/Find Your Hat.jpg" className="project-img" href="https://replit.com/@WanneeBuason/Challenge-Project-Find-Your-Hat#index.js" />
                <img src="./img/Jamming.jpg" className="project-img" href="https://wannee19.github.io/jsd-jamming-assessment" />
                <img src="./img/exercieswebapp.png" className="project-img" href="https://wannee19.github.io/" />

                
        </div>
        );
    }
}

export default Project;
